import React from "react";
import { useEffect, useState } from "react";
import { vendiaClient } from "./VendiaClient";

const { client } = vendiaClient();


export const DevicePage = () => {

    const[filteredTestList, setFilteredTestList] = useState();

    useEffect(() => {
        const filterTestList = async () => {
            const testList = await client.entities.test.list();
            setFilteredTestList(testList?.items);
            //console.log(testList?.items);


        }
        filterTestList();
    }, [])
    console.log(filteredTestList?.items);


    return(
        
        <div className="DevicePage">
            {filteredTestList?.map((item, index) => (
                        <div key={index}>   
                            {item}
                        </div>
                    )
                    )}
            <table>

                 <tr>
                    <th> TestID </th>
                    <th> OrgAssignment </th>
                    <th> TestName </th>
                    <th> TestMethod </th>
                    <th> Notes </th>
                    <th> Completed </th>
                    <th> UpdatedBy </th>
                </tr>   
                
                <tbody>

                </tbody>
            </table>
            
        </div>

    )
}
